import React from 'react'
import Post from './Post'

function PostList({ posts, deletePost, editPost}) {
  return (
    <div>{posts.map((post) => (
        <Post key={post.id} post={post} deletePost={deletePost} editPost={editPost} view/>
    ))}</div>
  )
}

export default PostList
